pragma solidity ^0.6.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/math/Math.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TriganDaoERC20Token is ERC20, Ownable {
    using SafeMath for uint256;

    uint8 internal _transactionDecimals = 20; // TKNBits multiplies of 100,
    uint8 internal _sellerTaxPercentage = 18;
    uint8 internal _buyerTaxPercentage = 6;
    uint256 internal _maxTransferFee = uint256(10) ** 28; // 10,000,000,000 tokens 
    address internal _projectTaxReceiver;
    address internal _liquidityTaxReceiver;
    address internal _marketingTaxReceiver;
    address internal _saleAddress;
    address[] internal _dutiesFree;

    constructor(uint256 initialSupply, address projectTaxReceiver, address liquidityTaxReceiver, address marketingTaxReceiver) public ERC20("TriganDAOE20", "TDE") {
        _mint(msg.sender, initialSupply);
        _projectTaxReceiver = projectTaxReceiver;
        _liquidityTaxReceiver = liquidityTaxReceiver;
        _marketingTaxReceiver = marketingTaxReceiver;
        _dutiesFree.push(owner());
    }

    /**
     * @dev See {IERC20-approve}.
     *
     * Requirements:
     *
     * - `spender` cannot be the zero address.
     */
    function approve(address spender, uint256 amount) public override returns (bool) {
        return super.approve(spender, amount);
    }

    /**
     * @dev Moves tokens `amount` from `sender` to `recipient`.
     *
     * This is internal function is equivalent to {transfer}, and can be used to
     * e.g. implement automatic token fees, slashing mechanisms, etc.
     *
     * Emits a {Transfer} event.
     *
     * Requirements:
     *
     * - `sender` cannot be the zero address.
     * - `recipient` cannot be the zero address.
     * - `sender` must have a balance of at least `amount`.
     */
    function _transfer(address sender, address recipient, uint256 amount) internal override {
        require(amount % (uint256(10) ** _transactionDecimals) == 0, "TDE: tokens to buy must be multiples of transaction decimals. Default 100");

        // at inital step, owner transfers all tokens to crowdsale account.
        // this is the IF for that action. We won't charge anything, for sure.
        // this step all so impress that add transaction from owner will be tax ignored.
        // event in burn process ?? am i right?
        if(sender == owner()) {
            return super._transfer(sender, recipient, amount);
        }

        uint256 sellerTaxAmount = _taxCalculator(sender, amount, _sellerTaxPercentage);
        uint256 buyerTaxAmount = _taxCalculator(recipient, amount, _buyerTaxPercentage);
        uint256 tax = sellerTaxAmount.add(buyerTaxAmount);

        require(balanceOf(sender) > amount.add(sellerTaxAmount), "TDE: you don't have enough tokens to sell");

        uint256 dividedTax = tax.div(3);

        // tax transfering
        super._transfer(sender, _projectTaxReceiver, dividedTax);
        super._transfer(sender, _liquidityTaxReceiver, dividedTax);
        super._transfer(sender, _marketingTaxReceiver, dividedTax);

        // buyer transfering
        super._transfer(sender, recipient, amount.sub(buyerTaxAmount));
    }

    /**
     * @dev calculate tax
     *
     * @param addr who need to check where they won't be charged in tax
     * @param tokenAmount Number of tokens to be purchased
     * @param percentage Tax percentage
     */
    function _taxCalculator(address addr, uint256 tokenAmount, uint8 percentage) internal view returns (uint256) {
        // transfer from _dutiesFree accounts won't be charged
        if (taxIgnoredFor(addr)) {
            return uint256(0);
        }

        return Math.min(tokenAmount.mul(percentage).div(100), _maxTransferFee);
    }

    /**
     * @dev set seller address 
     * @param addr seller address 
     */
    function setSaleAddress(address addr) public {
        _saleAddress = addr;
        _dutiesFree.push(_saleAddress);
    }

    /**
     * @dev detect duties free accounts
     * @param addr account's address to check
     */
    function taxIgnoredFor(address addr) internal view returns (bool) {
        for(uint256 i; i < _dutiesFree.length; i++) {
            if(_dutiesFree[i] == addr) {
                return true;
            }
        }

        return false;
    }

    /**
     * @dev burn tokens
     * @param amount Number of tokens to be burned
     */
    function burn(uint256 amount) public onlyOwner {
        _burn(_saleAddress, amount);
    }

    /**
     * @dev burn all unsold tokens 
     */
    function burnUnsold() public onlyOwner {
        uint256 amountToBurn = balanceOf(_saleAddress);

        _burn(_saleAddress, amountToBurn);
    }

    /**
     * @dev Add new token if needed
     * @param amount Number of tokens to be added
     */
    function add(uint256 amount) public onlyOwner {
        _mint(msg.sender, amount);
    }

    /**
     * @dev set buyer tax rate, default 6%. 
     * It must be multipies of 3 to be able to divided equally into Project, Marketing, Liquidity
     * @param rate Number of tax percentage that applied to buyer 
     */
    function setBuyerTaxRate(uint8 rate) public onlyOwner {
        require(rate % 3 == 0, "rate must be multipies of 3");
        require(rate < 100, "rate can't be greater than or equal 100");

        _buyerTaxPercentage = rate;
    }

    /**
     * @dev set buyer tax rate, default 18%. 
     * It must be multipies of 3 to be able to divided equally into Project, Marketing, Liquidity
     * @param rate Number of tax percentage that applied to seller 
     */
    function setSellerTaxRate(uint8 rate) public onlyOwner {
        require(rate % 3 == 0, "rate must be multipies of 3");
        require(rate < 100, "rate can't be greater than or equal 100");
        _sellerTaxPercentage = rate;
    }

    /**
     * @dev we can set it as 0 to allow all numbers of token can be transfer. Default 10,000,000,000.
     * @param maxTransferFee Number of tax limitation that applied to a transaction 
     */
    function setMaxTransferFee(uint256 maxTransferFee) public onlyOwner{
        _maxTransferFee = maxTransferFee;
    }

    /**
     * @dev we can set it as 0 to allow all numbers of token can be transfer. Default 2.
     * @param transactionDecimals Number of tax percentage that applied to seller 
     */
    function setDecimals(uint8 transactionDecimals) public onlyOwner returns (bool){
        if(transactionDecimals == 0) {
            _transactionDecimals = 0;
            return true;
        }

        _transactionDecimals = transactionDecimals + 18;
        return true;
    }

    /**
     * @dev Return decimals to user side which need to know if we limit transaction by decimals
     */
    function transactionDecimals() public view returns (uint8) {
        return _transactionDecimals;
    }
}

